import React from 'react';
import Heading from "./Heading";
import Paragraph from './Paragraph';
import List from './List';

function Com() {
    return (
        <>
            <Heading />
            <Paragraph />
            <List />
            <Heading />
            <Paragraph />
            <List />
        </>
    );
}

export default Com;
